Pascal is a programming language developed by Niklaus Wirth in the 1960s. Pascal's syntax is very close to Ada or Modula-2, which makes it an excellent teaching language for beginners. A Hello World! program is a simple computer program that prints "Hello, world!" to the screen.
The following is a "Hello, world!" program written in standard Pascal:
Program   HelloWorld ;
{ This program just displays "Hello, world!" on the screen }
    writeln ( 'Hello, world!' ) ;
This code uses the WriteLn function from the System unit of Turbo Pascal. Note: The line with the semicolon is not necessary but is generally included to help the programmer see where the procedure ends. In Pascal, each statement and declarations must be followed by a semicolon (;). However, the last one in a block is considered unnecessary and many programmers omit it. It does not appear in the ISO Standard Pascal.
If you are using Free Pascal, you would use this slightly different version:
program   helloworld ;
uses   crt ;
begin { Main }
