```c
#include <stdio.h>

// Function to round a double to two decimal places
double roundToTwoDecimals(double num) {
    return (int)((num * 100 + 0.5)) / 100;
}

int main() {
    double number = 10.6789;

    printf("Original Number: %.4f\n", number);
    printf("Rounded to Two Decimal Places: %.2f\n", roundToTwoDecimals(number));

    return 0;
}
```
**Explanation**

*   The `roundToTwoDecimals` function takes a `double` as input.
*   It multiplies the input number by 100 to shift the decimal point two places to the right.
*   Adding 0.5 to the result ensures that numbers ending in.5 are rounded up instead of down.
*   Casting the result to an `int` effectively rounds it to the nearest



